        <div className="card text-white bg-primary mb-3 rounded-pill">
            <div className="card-header">Bitcoin</div>
            <div className="card-body">
                <h4 className="card-title">Precio Actual</h4>
            </div>
        </div>
    );
};

export default Precio;
